const canvas = document.getElementById('canvas1');
const ctx = canvas.getContext('2d');
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;
let particlesArray = [];
let adjustX = 2;
let adjustY = 20;

// mouse handling
let mouse = {
    x: null,
    y: null,
    radius: 150
}

window.addEventListener('mousemove', function (e){
    mouse.x = e.x;
    mouse.y = e.y;
});

const myNewImage = new Image();
myNewImage.src = 'Image/IMG_0715.jpeg';
ctx.fillStyle = 'white';
ctx.font = '10px Futura';
ctx.fillText('REEL', 1, 15);
const textCoordinates = ctx.getImageData(0, 0, 100, 100);

class Particle {
    constructor(x,y){
        this.x = x;
        this.y = y;
        this.size = 3;
        this.baseX = this.x;
        this.baseY = this.y;
        this.density = (Math.random() * 80) + 5;
    }
    draw(){
        ctx.fillStyle = 'rgb(245,245,245)';
        ctx.beginPath();
        ctx.arc(this.x, this.y,this.size, 0, Math.PI * 2);
        ctx.closePath();
        ctx.fill();
    }
    update(){
        let dx = mouse.x - this.x;
        let dy = mouse.y - this.y;
        let distance = Math.sqrt(dx * dx + dy + dy);
        let forceDirectionX = dx / distance;
        let forceDirectionY = dy / distance;
        let maxDistance = mouse.radius;
        let force = (maxDistance - distance) / maxDistance;
        let directionX = forceDirectionX * force * this.density;
        let directionY = forceDirectionY * force * this.density;
        if (distance < 20) {
            this.x -= directionX;
            this.y += directionY;
        } else {
           if (this.x !== this.baseX){
               let dx = this.x -this.baseX;
               this.x -= dx/30
           }
           if (this.y !== this.baseY){
               let dy = this.y - this.baseY;
               this.y -= dy/30;
           }
        }
    }
}

function init() {
    particlesArray = [];
    for (let y = 0, y2 = textCoordinates.height; y < y2; y++){
        for (let x = 0, x2 = textCoordinates.width; x < x2; x++){
            if (textCoordinates.data[(y * 4 * textCoordinates.width) + (x * 4) + 3] > 128){
                let positionX = x + adjustX;
                let positionY = y + adjustY;
                particlesArray.push(new Particle(positionX * 20, positionY * 20));
            }
        }
    }
    // for (let i = 0; i < 500; i++ ) {
    //     let x = Math.random() * canvas.width;
    //     let y = Math.random() * canvas.height
    //     particlesArray.push(new Particle(x,y));
    // }

}
init();
console.log(particlesArray);

function animate() {
    ctx.clearRect(0,0,canvas.width, canvas.height);
    for (let i = 0; i < particlesArray.length; i++) {
        particlesArray[i].draw();
        particlesArray[i].update();
    }
    requestAnimationFrame(animate);
}
animate();




const myImage = new Image();
myImage.src ='data:image/jpeg;base64,';


myImage.addEventListener('load', function() {
const canvas = document.getElementById('canvas1');
const ctx = canvas.getContext('2d');
canvas.width = 500;
canvas.height = 706;

ctx.drawImage(myImage, 0,0, canvas.width, canvas.height);
const pixels = ctx.getImageData(0,0,canvas.width, canvas.height);
ctx.clearRect(0,0,canvas.width, canvas.height);
// console.log(pixels)

let particlesArray = [];
const numberOfParticles = 5000;

let mappedImage = [];
for (let y = 0; y < canvas.height; y++){
    let row = [];
    for (let x = 0; x < canvas.width; x++){
        const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
        const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
        const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
        const brightness = calculateRelativeBrightness(red,green,blue);
        const cell = [
            cellBrihtness = brightness
        ];
        row.push(cell);
    }
    mappedImage.push(row);
}
console.log(mappedImage)

function calculateRelativeBrightness(red, green, blue){
    return Math.sqrt(
        (red * red) * 0.299 + 
        (green * green) * 0.587 +
        (blue * blue) * 0.114
    )/100;
}


class Particle {
    constructor(){
        this.x = Math.random() * canvas.width;
        this.y = 0;
        this.speed = 0;
        this.velocity = Math.random() * 0.5;
        this.size = Math.random() * 1.5 + 1;
        this.position1 = Math.floor(this.y);
        this.position2 = Math.floor(this.x);

    }
    update(){
        this.position1 = Math.floor(this.y);
        this.position2 = Math.floor(this.x);
        this.speed = mappedImage[this.position1][this.position2][0];
        let movement = (2.5 - this.speed) + this.velocity;
        
        this.y += movement;
        if (this.y >= canvas.height){
            this.y =0;
            this.x = Math.random() * canvas.width;

        }
    }
    draw(){
        ctx.beginPath();
        ctx.fillStyle = 'rgb(255,215,0)';
        ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
        ctx.fill();
    }
}
function init(){
    for (let i =0; i < numberOfParticles; i++){
        particlesArray.push(new Particle);
    }
}
init();
function animate(){
    ctx.globalAlpha = 0.05;
    ctx.fillStyle = 'rgb(0,0,0)';
    ctx.fillRect(0,0,canvas.width, canvas.height);
    ctx.globalAlpha = 0.2;
    for (let i = 0; i < particlesArray.length; i++){
        particlesArray[i].update();
        ctx.globalAlpha = particlesArray[i].speed * 0.5;
        particlesArray[i].draw();
    }
    requestAnimationFrame(animate);
}
animate();

})